import {StyleSheet, View, Text, Button} from 'react-native'
import * as React from 'react';
import { createNativeStackNavigator } from '@react-navigation/native-stack'
import { Soft } from '../routes/Soft';
import { useNavigation } from '@react-navigation/native';


const Stack = createNativeStackNavigator();

export function Premade({navigation: {navigate}}) {
  
  
  function Default() {
    return (
      <View style={styles.container}>
            <Button 
              title="Soft"
              color='#2196F3'
              onPress={() => {navigate(<Stack.Screen name="Soft" component={Soft} />)}}
            />
            <Button 
              title="Moderate"
              color='#2196F3'
              onPress={() => {ref.current && ref.current.navigate(<Stack.Screen name="Premade" component={Soft} />)}}
            />
            <Button 
              title="Firm"
              color='#2196F3'
              onPress={() => {ref.current && ref.current.navigate('Firm')}}
            />
        </View>
    );
  }

  return (
    <View style={{flex:1}}>
      
        
        <Default />
      
    </View>
  );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
});
